import React, { useState } from "react";
import './';

function App(props) {


    const [tasks] = useState(props.tasks);

    return (
        <div className="col">
            {
            tasks.map(task => <div className="chain">{"Nombre:" + task.data + "\n" + "Hash:" + task._id + "\n"+ "Prev:" + task.prev} <hr className="dashed"/> </div>)
            }
        </div>
    );

}

    export default App;
